import React from 'react';

function Story() {
  return (
    <div className='relative h-screen bg-black text-white'>
      <h1 className='text-7xl absolute top-10 right-10'>Our Story</h1>
      <video autoPlay loop muted className='absolute top-20 right-0 h-3/4' src="https://www.exoape.com/video/video-6.mp4"></video>
    </div>
  );
}

export default Story;
